"use client";
import React, { useEffect, useState } from "react";
import CardDataStats from "../CardDataStats";
import API from "@/services/services";
import store from "@/redux/store";

const Dashboard: React.FC = () => {

  const Auth = store.getState().Auth?.auth

  const [dataUser, setDataUser] = useState<any>(null)
  const [dataVisual, setDataVisual] = useState<any>(null)

  useEffect(() => {
    (async () => {
      const responseUser = await API.getAllUsers()
      setDataUser(responseUser?.data?.data)
      console.log('daftar anggota:', responseUser)

      const responseVisual = await API.getAllVisual()
      console.log('daftar daat isual:', responseVisual)
      setDataVisual(responseVisual?.data?.data)
    })()
  }, [])

  return (
    <>
      <div className="w-[100%] mb-2 h-max flex items-center bg-white p-12 shadow-md">
        <h2 className="text-[28px] text-black">Selamat datang <b>{Auth?.username}</b> ðŸ‘‹</h2>
      </div>

      <div className="grid grid-cols-1 gap-4 md:grid-cols-2 md:gap-6 xl:grid-cols-4 2xl:gap-7.5">
        <CardDataStats title="Jumlah data visual" total={dataVisual?.length}>
          <img className="w-[60%]" src={'data:image/png;base64,'} alt="jumlah data visual" />
        </CardDataStats>

        <CardDataStats title="Jumlah anggota" total={dataUser?.length}>
          <img className="w-[50%]" src={'data:image/png;base64,'} alt="jumlah-anggota" />
        </CardDataStats>

        <CardDataStats title="Jumlah super-admin" total={dataUser?.filter((data: any) => data?.role === 'super-admin')?.length}>
          <img className="w-[50%]" src={'data:image/png;base64,'} alt="jumlah-super-admin" />
        </CardDataStats>

        <CardDataStats title="JUmlah sub-admin" total={dataUser?.filter((data: any) => data?.role === 'sub-admin')?.length}>
          <img className="w-[50%]" src={'data:image/png;base64,'} alt="jumlah-super-admin" />
        </CardDataStats>
      </div>

    </>
  );
};

export default Dashboard;
